  summary: |-
    Returns an iterator over elements of type <code>T</code>. The elements are returned in nondecreasing
     order according to the associated <xref uid="#comparator" data-throw-if-not-resolved="false">#comparator</xref>.

     <p>Elements that occur multiple times in the multiset will appear multiple times in this
     iterator, though not necessarily sequentially.

     <p>The iterator returns the elements in ascending order according to this multiset's
     comparator.
